import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

// MUI Imports
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';

function AnalysisResults() {
    const location = useLocation();
    const navigate = useNavigate();
    const analysis = location.state?.analysis;

    if (!analysis) {
        return (
            <Box sx={{ p: 4, textAlign: 'center' }}>
                <Typography variant="h5" component="h2" gutterBottom>No Analysis Data Available</Typography>
                <Typography variant="body1">Please go back to the home page to upload your resume and job description.</Typography>
                <Button variant="contained" sx={{ mt: 2 }} onClick={() => navigate('/home')}>Go to Home</Button>
            </Box>
        );
    }
    
    const isResumeAnalysis = analysis.analysisType === 'resume';
    const isJobDescAnalysis = analysis.analysisType === 'jobDescription';

    // Chart data and options for Resume vs. Trending Skills
    const resumeChartData = isResumeAnalysis && {
        labels: analysis.trendingSkills?.map(s => s[0]) || [],
        datasets: [
            {
                label: 'Trending Skills in Jobs',
                data: analysis.trendingSkills?.map(s => s[1]) || [],
                backgroundColor: 'rgba(54, 162, 235, 0.5)',
                borderColor: 'rgba(54, 162, 235, 1)',
                borderWidth: 1,
            },
            {
                label: 'Your Skills',
                data: analysis.trendingSkills?.map(s => analysis.skills?.includes(s[0]) ? s[1] : 0) || [],
                backgroundColor: 'rgba(75, 192, 192, 0.5)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1,
            },
        ],
    };

    // Chart data and options for My Skills vs. Job Description
    const jobDescChartData = isJobDescAnalysis && {
        labels: [...new Set([...(analysis.mySkills || []), ...(analysis.jobDescriptionSkills || [])])],
        datasets: [
            {
                label: 'Your Skills',
                data: [...new Set([...(analysis.mySkills || []), ...(analysis.jobDescriptionSkills || [])])].map(skill => (analysis.mySkills || []).includes(skill) ? 1 : 0),
                backgroundColor: 'rgba(75, 192, 192, 0.5)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1,
            },
            {
                label: 'Job Required Skills',
                data: [...new Set([...(analysis.mySkills || []), ...(analysis.jobDescriptionSkills || [])])].map(skill => (analysis.jobDescriptionSkills || []).includes(skill) ? 1 : 0),
                backgroundColor: 'rgba(255, 99, 132, 0.5)',
                borderColor: 'rgba(255, 99, 132, 1)',
                borderWidth: 1,
            },
        ],
    };

    const jobDescChartOptions = {
        responsive: true,
        scales: {
            y: { beginAtZero: true, max: 1, ticks: { display: false } },
            x: { grid: { display: false } },
        },
        plugins: {
            legend: { position: 'top' },
            title: { display: true, text: 'Your Skills vs. Job Required Skills' },
        },
    };

    const handleGoBack = () => {
         navigate('/home');
    };

    return (
        <Box sx={{ p: 4 }}>
            <Button variant="outlined" onClick={handleGoBack} sx={{ mb: 2 }}>Go Back</Button>
            
            <Typography variant="h4" component="h2" gutterBottom>Analysis Results</Typography>
            
            {isResumeAnalysis && (
                <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
                    <Typography variant="h5" component="h3" gutterBottom>Resume Skills vs. Trending Jobs</Typography>
                    <Typography variant="body2">This chart compares your skills with skills currently in demand based on job market trends.</Typography>
                    {analysis.trendingSkills && analysis.trendingSkills.length > 0 ? (
                        <Box sx={{ width: '80%', margin: 'auto', mt: 3 }}>
                            <Bar data={resumeChartData} options={{ responsive: true, plugins: { legend: { display: true }, title: { display: true, text: 'Resume Skills vs. Trending Jobs' } } }} />
                        </Box>
                    ) : (
                        <Typography variant="body1" sx={{ mt: 2 }}>No trending skills data available to visualize.</Typography>
                    )}
                    <hr/>
                    <Typography variant="h5" component="h3" gutterBottom>Current Job Openings</Typography>
                    {analysis.currentJobs && analysis.currentJobs.length > 0 ? (
                        <List>
                            {analysis.currentJobs.map((job, index) => (
                                <ListItem key={index} divider>
                                    <ListItemText
                                        primary={<strong>{job.title}</strong>}
                                        secondary={
                                            <React.Fragment>
                                                <Typography component="span" variant="body2" color="text.primary">{job.company} - {job.location}</Typography>
                                                <br/>
                                                <Typography component="span" variant="caption" color="text.secondary">Posted: {job.posted_at}</Typography>
                                                <br/>
                                                {job.description.substring(0, 150)}...
                                                <br/>
                                                <Link href={job.apply_link} target="_blank" rel="noopener noreferrer">Apply Now</Link>
                                            </React.Fragment>
                                        }
                                    />
                                </ListItem>
                            ))}
                        </List>
                    ) : (
                        <Typography variant="body1">No current job openings found.</Typography>
                    )}
                </Paper>
            )}

            {isJobDescAnalysis && (
                <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
                    <Typography variant="h5" component="h3" gutterBottom>Your Skills vs. Job Required Skills</Typography>
                    <Typography variant="body2">This chart shows how your resume skills match the skills required by the provided job description.</Typography>
                    {jobDescChartData && (
                        <Box sx={{ width: '80%', margin: 'auto', mt: 3 }}>
                            <Bar data={jobDescChartData} options={jobDescChartOptions} />
                        </Box>
                    )}
                    <hr/>
                    <Typography variant="h5" component="h3" gutterBottom>Skills You Should Learn</Typography>
                    {analysis.skillGaps && analysis.skillGaps.length > 0 ? (
                        <List>
                            {analysis.skillGaps.map((gap, index) => (
                                <ListItem key={index}>
                                    <ListItemText primary={gap} />
                                </ListItem>
                            ))}
                        </List>
                    ) : (
                        <Typography variant="body1">You have all the required skills for this job! 🎉</Typography>
                    )}
                    <hr/>
                    <Typography variant="h5" component="h3" gutterBottom>Recommended Courses</Typography>
                    {analysis.recommendedCourses && analysis.recommendedCourses.length > 0 ? (
                        <List>
                            {analysis.recommendedCourses.map((rec, index) => (
                                <ListItem key={index}>
                                    <ListItemText primary={<strong>{rec.skill}</strong>} secondary={rec.course} />
                                </ListItem>
                            ))}
                        </List>
                    ) : (
                        <Typography variant="body1">No course recommendations at this time.</Typography>
                    )}
                </Paper>
            )}
        </Box>
    );
}

export default AnalysisResults;
